def decpart(num):
	return num - math.floor(num)

def freq2centhist(freqs):
	hist = list(map(lambda _: 0, range(1200)))
	cents = list(map(
		lambda f: round(decpart(math.log2(f / 440000)) * 1200),
		freqs
	))
	for cent in cents:
		hist[cent] += 1
	return hist

